import { useState } from "react";
import Card from "./Card";

function Product() {

    const [active, setActive] = useState(0);
    const [complete, setComplete] = useState(0);
    return (
        <>
            <h2>My FlightPaths</h2>
            <p>Active({active})</p>
            <p>Complete({complete})</p>
            <div>
                <Card />
            </div>
            <div>
                <Card />
            </div>

        </>
    );

}

export default Product;
